import { Route, Switch } from 'react-router-dom';

const Body = () => (
  <div>
    <Switch>
      <Route path="/">This is top page</Route>
      <Route path="/news">This is news page</Route>
      <Route path="/about">This is about page</Route>
    </Switch>
  </div>
)

export default Body;
